// HasUser applies the HasEdge predicate on the "user" edge.
func HasUser() predicate.RecurringSubscription {
	return predicate.RecurringSubscription(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, UserTable, UserColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasUserWith applies the HasEdge predicate on the "user" edge with a given conditions (other predicates).
func HasUserWith(preds ...predicate.User) predicate.RecurringSubscription {
	return predicate.RecurringSubscription(func(s *sql.Selector) {
		step := newUserStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.RecurringSubscription) predicate.RecurringSubscription {
	return predicate.RecurringSubscription(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.RecurringSubscription) predicate.RecurringSubscription {
	return predicate.RecurringSubscription(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.RecurringSubscription) predicate.RecurringSubscription {
	return predicate.RecurringSubscription(sql.NotPredicates(p))
}
